import React from 'react'
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";
import Contact from './utils/Contact';
function App(){
  return (
    <>

      <div>
        <nav>
          <ul>
            <li>
              <Link to="/Home"><Home/></Link>
            </li>
            <li>
              <Link to="/contact"><Contact/></Link>
            </li>
            <li>
              <Link to="/users">Users</Link>
            </li>
          </ul>
        </nav>

      </div>
</>
  );
}
export default App;

function Home() {
  return <h2>Home</h2>;
}

function About() {
  return <h2>About</h2>;
}

function Users() {
  return <h2>Users</h2>;
}
